DECLARE @var0 sysname;
SELECT @var0 = [d].[name]
FROM [sys].[default_constraints] [d]
INNER JOIN [sys].[columns] [c] ON [d].[parent_column_id] = [c].[column_id] AND [d].[parent_object_id] = [c].[object_id]
WHERE ([d].[parent_object_id] = OBJECT_ID(N'[Registrations]') AND [c].[name] = N'ConfirmPassword');
IF @var0 IS NOT NULL EXEC(N'ALTER TABLE [Registrations] DROP CONSTRAINT [' + @var0 + '];');
ALTER TABLE [Registrations] DROP COLUMN [ConfirmPassword];

